// Custom order array
const customOrder: string[] = [
  'highland-park',
  'preston-hollow',
  'park-cities',
  'university-park',
  'greenway-parks',
  'bluffview-area',
  'turtle-creek-corridor',
];

// Function to sort edges based on customOrder
function sortNeighborhoodsByCustomOrder(
  neighborhoods: any[],
  order: string[]
): any[] {
  const orderMap = new Map<string, number>(
    order.map((slug, index) => [slug, index])
  );
  return neighborhoods.sort((a, b) => {
    const indexA: number = orderMap.has(a.node.slug)
      ? (orderMap.get(a.node.slug) as number)
      : Infinity;
    const indexB: number = orderMap.has(b.node.slug)
      ? (orderMap.get(b.node.slug) as number)
      : Infinity;
    return indexA - indexB;
  });
}

// Sort the neighborhoods
const sortedEdges = sortNeighborhoodsByCustomOrder(
  _significantNeighborhoods.data.neighborhoods.edges,
  customOrder
);

// Reassign sorted result back to _significantNeighborhoods
_significantNeighborhoods.data.neighborhoods.edges = sortedEdges;

export { _significantNeighborhoods };

export const _significantNeighborhoodsSlugs =
  _significantNeighborhoods.data.neighborhoods.edges.map((edge) => {
    return { slug: edge.node.slug };
  });
